export interface Unit {
    unitCode: string;
    unitId: number;
}
export interface TicketItem {
    amount: number;
    delivery: string;
    deliveryDate: string;
    deliveryDateObj?: Date;
    deliveryQuantity: number;
    freightAmount: number;
    productDesc: string;
    taxAmount: number;
    ticketCode: number;
    unit: Unit;
    unitPrice: number;
}
export interface File {
    blobDocumentID: number;
    documentTypeCode: string;
    documentTypeDesc: string;
    ticketCode: string;
    fileName: string;
    fileContent: string;
}
export interface DeliveryTicket {
    contract: string;
    docDate: string;
    docDateObj?: Date;
    externalDelivery: string;
    pointOfDeliveryAddress: string;
    pointOfDeliveryCode: number;
    pointOfDeliveryDesc: string;
    purchaseOrder: string;
    ticketCode: number;
    ticketItem: TicketItem[];
    files: File[];
}
export interface DeliveryTickets {
    tickets: DeliveryTicket[];
}
